        public bool PlaceCrystalCave(int i, int j)
        {
            for (int y = 0; y < _CrystalCaveshape.GetLength(0); y++)
                for (int x = 0; x < _CrystalCaveshape.GetLength(1); x++)
                {
                    int k = i + x;
                    int l = j + y;
                    if (WorldGen.InWorld(k, l, 40))
                    {
                        var tile = Framing.GetTileSafely(k, l);
                        switch (_CrystalCaveshape[y, x])
                        {
                            case 1:
                                tile.type = (ushort)ModContent.TileType<CavernStone>();
                                tile.wall = (ushort)ModContent.WallType<CavernWall>();
                                tile.active(true);
                                break;
                            case 2:
                                tile.type = (ushort)ModContent.TileType<CavernCrystal>();
                                tile.wall = (ushort)ModContent.WallType<CavernWall>();
                                tile.active(true);
                                break;
                            case 3:
                                //WorldGen.KillWall(i, j);
                                tile.wall = (ushort)ModContent.WallType<CavernWall>();
                                tile.active(false);
                                break;
                        }
                        /*switch (_CrystalCaveshapeWall[y, x]) 
						{
							case 1:
								tile.wall = 1;
								break;
						}*/
                    }
                }
            
            return true;
        }
    }
